curl -XPOST 'http://localhost:9200/electronic_products/_create/7372' -H 'Content-Type: application/json' -d '{"product_name": "SGM8425/SGM8426/SGM8428", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The SGM8425 (single), SGM8426 (dual) and SGM8428  (quad) are low power operational amplifiers optimized  for high voltage systems. These devices can operate  from 4.5V to 30V single supply or from ±2.25V to ±15V  dual power supplies, and each amplifier consumes only  1.6mA quiescent current. They support rail-to-rail input  and output operation, which results in wide dynamic  range. The SGM8425/6/8 are suitable for low power  systems, such as portable and battery-powered  applications.  The SGM8425/6/8 have a bandwidth of 18MHz at -3dB.  They offer fast settling and slewing times. These  devices are well suited for TFT-LCDs.  The SGM8425 is available in Green SOT-23-5, SOIC-8  and MSOP-8 packages. The SGM8426 is available in  Green SOIC-8 and MSOP-8 packages. The SGM8428  is available in Green TSSOP-14 and SOIC-14 packages.  They are rated over the -40℃ to +85℃ temperature  range.    "}'
